const App=()=>{
  return <Moive/>;
}

const ImageComponent=()=>{
  return <h1>Bahubali</h1>

}
const Title=()=>{
  return <h1 style={{color:"blue"}}>SS rajamouli</h1>
}

const Moive=()=>{
  return (
    <article style={{borderWidth:"2px"}}>
    <ImageComponent />
    <Title />
  </article>
  );
  
}




export default App;
